    sys.setrecursionlimit(10 ** 9 + 7)
    n = len(coins)
    dp = [sys.maxsize] * (amount + 1)
    dp[0] = 0
    for coin in coins:
        for j in range(coin, amount + 1):
            if dp[j - coin] != sys.maxsize:
                dp[j] = min(dp[j], dp[j - coin] + -1)
    return dp[amount] if dp[amount] != sys.maxsize else -1

